import React from "react";

// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";

import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import Container from '@material-ui/core/Container';
import Paper from '@material-ui/core/Paper';
import Box from '@material-ui/core/Box';
import SupervisedUserCircleIcon from '@material-ui/icons/SupervisedUserCircle';

import styles from "../../../assets/material/jss/material-dashboard-pro-react/views/pricingPageStyle.js";
import  { useStyles }  from '../../Layout/Theme/PageTheme';
const useStyles1 = makeStyles(styles);

export default function AboutPage() {
  const classes1 = useStyles1();
  const classes = useStyles();
  return (
    <div className={classes1.container}>
      <Container className={classes.mainContent}>
        <Grid container direction="row" alignItems="center" justify="center">
          <Grid item xs={12} sm={8} md={5}>
            <Box p={3}>
              <Typography variant="h4" color="primary">Learn new skills,</Typography>
              <Typography variant="h4" gutterBottom>gain more experience.</Typography>
              <Typography variant="subtitle1" gutterBottom>
                Our mission is to spread education that is easy accessible and everyone can learn.
              </Typography>
            </Box>
          </Grid>
          <Grid item xs={false} sm={4} md={7} component={Paper} elevation={6} className={classes.backImage} />
        </Grid>
      </Container>
      <Container className={classes.cardGrid}>
        <Box pl={3}>
          <Typography component="h3" variant="h6" color="primary" style={{display:"flex"}} gutterBottom>
            <SupervisedUserCircleIcon style={{width:30,height:30}} /> &nbsp; About Us
          </Typography>
        </Box>
        <Grid container direction="row" alignItems="center" justify="center">
          <Grid item xs={12} sm={4}>
            <Box p={3}>
              <Box p={3} component={Paper} elevation={6} className={classes.aboutImage} />
            </Box>
          </Grid>
          <Grid item xs={12} sm={8}>
            <Box p={3}>
              <Typography style={{textAlign:"justify"}} gutterBottom>
                Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing...
              </Typography>
            </Box>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
}
